package Set1;

public class Swap_Numbers_With_Using_Third_Var {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
      int a=10;
      int b=20;
      int c;
      c=a;
      a=b;
      b=c;
      System.out.println("a : "+a);
      System.out.println("b : "+b);
	}

}
